style.css:
@-moz-document url-prefix("https://mlbpark.donga.com/mp/b.php") {
/* Common Style */
* {
    margin: 0;
    padding: 0;
    word-spacing: 1px;
}

html,
body {
    margin: 0;
    padding: 0;
    height: 100%;
}

body {
    font-family: "돋움", Dotum, sans-serif, Arial;
    font-size: 12px;
    position: relative;
}

table,
div {
    border-collapse: collapse;
}

select,
textarea,
input {
    font-family: "돋움", Helvetica, sans-serif;
    font-size: 12px;
    color: #000;
    vertical-align: top;
}
}
